(window.webpackJsonp=window.webpackJsonp||[]).push([[0],[function(t,n,d){(function(n){var i=d(10);n.$=i,n.jQuery=i,d(11),t.exports={renderMarkdown:function(t,n){var i=d(12)("./"+n);document.getElementById(t).innerHTML=i}}}).call(this,d(9))},function(t,n,d){t.exports=d.p+"images/docs1.33763888268052bdd01519e12968e136.png"},function(t,n,d){t.exports=d.p+"images/docs2.21379cc93ea79bbae6dcdf8476039f85.png"},function(t,n,d){t.exports=d.p+"images/docs3.0b3f598d2f8067730449916200656eeb.png"},function(t,n,d){t.exports=d.p+"images/docs4.69a257146e4e63b24e22481ffc244a7f.png"},function(t,n,d){t.exports=d.p+"images/docs5.e2d788631fc7f51bb1424be89e15af31.png"},function(t,n,d){t.exports=d.p+"images/docs6.46cd2f98207ff5ad75151b7308cf7eae.png"},function(t,n,d){t.exports=d.p+"images/docs8.2860a9bc3ced23924a86b84af09d7c10.png"},,,,,function(t,n,d){var i={"./api-demo-download.md":13,"./api-initiate-pay.md":14,"./api-transaction-query.md":15,"./imgs/docs1.png":1,"./imgs/docs2.png":2,"./imgs/docs3.png":3,"./imgs/docs4.png":4,"./imgs/docs5.png":5,"./imgs/docs6.png":6,"./imgs/docs8.png":7,"./install-desc.md":16};function a(t){var n=p(t);return d(n)}function p(t){var n=i[t];if(n+1)return n;var d=new Error("Cannot find module '"+t+"'");throw d.code="MODULE_NOT_FOUND",d}a.keys=function(){return Object.keys(i)},a.resolve=p,(t.exports=a).id=12},function(t,n){t.exports='<h3 id="-">前端</h3>\n<p><a href="https://gitee.com/sipengcode/quick-pay" target="_blank">https://gitee.com/sipengcode/quick-pay</a></p>\n<h3 id="app-">APP端</h3>\n<p><a href="https://gitee.com/DaLianZhiYiKeJi/xpay" target="_blank">https://gitee.com/DaLianZhiYiKeJi/xpay</a></p>\n<h3 id="-">配套程序下载</h3>\n<p><a href="https://pan.baidu.com/s/1UPAFLCjYGyO_scRePXDdHA" target="_blank">https://pan.baidu.com/s/1UPAFLCjYGyO_scRePXDdHA</a></p>\n'},function(t,n){t.exports='<h4 id="-2-">接口分2中.请选择自己对应的方式</h4>\n<h5 id="1-xposed-https-xpapi-ukafu-com-xppayapi">1 : 活码,xposed版本,不需要上传二维码的. 接口地址: <a href="https://xpapi.ukafu.com/xppayapi">https://xpapi.ukafu.com/xppayapi</a></h5>\n<h5 id="2-https-pxpay-ukafu-com-pxpayapi">2 : 死码,监控通知的版本,必须手动上传二维码. 接口地址: <a href="https://pxpay.ukafu.com/pxpayapi">https://pxpay.ukafu.com/pxpayapi</a></h5>\n<h2 id="-">接口参数</h2>\n<table class="table table-bordered">\n    <thead>\n    <tr class=\'api-doc-table\'>\n        <th>参数名</th>\n        <th>含义</th>\n        <th>类型</th>\n        <th>选填/必填</th>\n        <th>说明</th>\n    </tr>\n    </thead>\n    <tbody>\n    <tr>\n        <th scope="row">merchantid</th>\n        <td>商户ID</td>\n        <td>string</td>\n        <td>必填</td>\n        <td>商户唯一标识，在APP中可以差看商户密钥</td>\n    </tr>\n    <tr>\n        <th scope="row">amount</th>\n        <td>金额</td>\n        <td>float</td>\n        <td>必填</td>    \n        <td>付款的金额，单位：元，精确到小数点后两位</td>\n    </tr>\n    <tr>\n        <th scope="row">paytype</th>\n        <td>渠道</td>\n        <td>string</td>\n        <td>必填</td>    \n        <td>订单金额</td>\n    </tr>\n    <tr>\n        <th scope="row">notify_url</th>\n        <td>通知接口地址</td>\n        <td>string</td>\n        <td>必填</td>    \n        <td>用户支付成功后，ukafu会发送通知信数据到此链接.请确保此链接能被外网访问</td>\n    </tr>\n    <tr>\n        <th scope="row">return_url</th>\n        <td>跳转地址</td>\n        <td>string</td>\n        <td>必填</td>\n        <td>用户支付成功后用户浏览器自动跳转到这个网址</td>\n    </tr>\n    <tr>\n        <th scope="row">orderid</th>\n        <td>商户订单号</td>\n        <td>string</td>\n        <td>必填</td>\n        <td>您自己的订单号，确保唯一性</td>\n    </tr>\n    <tr>\n        <th scope="row">client_ip</th>\n        <td>用户IP</td>\n        <td>string</td>\n        <td>必填</td>\n        <td>用户请求的IP.注意是用户IP.不是服务器IP</td>\n    </tr>\n    <tr>\n        <th scope="row">sign</th>\n        <td>签名</td>\n        <td>string</td>\n        <td>必填</td>\n        <td>由签名算法生成的签名</td>\n    </tr>\n    <tr>\n        <th scope="row">ext</th>\n        <td>拓展字段</td>\n        <td>string</td>\n        <td>选填</td>\n        <td>此字段可以用来放用户id,等信息.原样返回</td>\n    </tr>\n    </tbody>\n</table>\n\n\n\n\n<h2 id="-">返回值</h2>\n<table class="table table-bordered">\n    <thead>\n    <tr class=\'api-doc-table\'>\n        <th>参数名</th>\n        <th>含义</th>\n        <th>类型</th>\n        <th>选填/必填</th>\n        <th>说明</th>\n    </tr>\n    </thead>\n    <tbody>\n    <tr>\n        <th scope="row">orderid</th>\n        <td>系统订单流水号</td>\n        <td>string</td>\n        <td>必填</td>\n        <td> 订单ID,如果自己没有支付页面.可以使用系统提供的支付页面.将此参数带入即可,https://pxpay.ukafu.com/qr/pay.html? orderid=xx</td>\n    </tr>\n    <tr>\n        <th scope="row">paytype</th>\n        <td>ALIPAY/WXPAY</td>\n        <td>string</td>\n        <td>必填</td>\n        <td>支付方式.支付宝/微信</td>\n    </tr>\n    <tr>\n        <th scope="row">money</th>\n        <td>订单金额</td>\n        <td>string</td>\n        <td>必填</td>\n        <td>订单金额</td>\n    </tr>\n    <tr>\n        <th scope="row">remark</th>\n        <td>订单备注</td>\n        <td>string</td>\n        <td>选填</td>\n        <td>如果有备注,就存在.如果非xposed,是没有备注的</td>\n    </tr>\n    </tbody>\n</table>\n\n\n<h2 id="-">返回值如何处理?</h2>\n<p>返回值是个json,解析之后如果给用户展示支付页面?</p>\n<ul>\n<li><p>1.快速使用,直接跳转到我们提供的网址:\n<a href="https://pxpay.ukafu.com/qr/pay.html?orderid=xxxxxxxxxxxxxxxx">https://pxpay.ukafu.com/qr/pay.html?orderid=xxxxxxxxxxxxxxxx</a>\nxxxx就是返回值的orderid</p>\n</li>\n<li><p>2.利用官网提供的支付页面源码.自己架设一个支付页面:\n<a href="https://gitee.com/sipengcode/quick-pay">https://gitee.com/sipengcode/quick-pay</a></p>\n</li>\n<li><p>3.(不推荐) 自己解析二维码,根据支付宝/微信/手机/pc四个环境提示不同的支付信息,利用服务器或者js生成二维码图片.</p>\n<h5 id="-">支付宝:</h5>\n<ul>\n<li>a)PC:显示二维码图,用户用手机扫一扫</li>\n<li>b)手机:自动打开二维码的链接,会拉起支付宝到支付页<h5 id="-">微信:</h5>\n</li>\n<li>a)PC:显示二维码,用户用手机扫;</li>\n<li>b)手机:是否在微信里?\n在微信,则提示玩家识别图中二维码,\n在浏览器,提示玩家保存二维码到相册,然后再打开微信.识别相册中的二维码.</li>\n</ul>\n</li>\n</ul>\n<h2 id="-">回调参数</h2>\n<table class="table table-bordered">\n    <thead>\n    <tr class=\'api-doc-table\'>\n        <th>参数名</th>\n        <th>含义</th>\n        <th>类型</th>\n        <th>选填/必填</th>\n        <th>说明</th>\n    </tr>\n    </thead>\n    <tbody>\n    <tr>\n        <th scope="row">orderid</th>\n        <td>系统订单ID</td>\n        <td>string</td>\n        <td>必填</td>\n        <td> 系统产生的流水id</td>\n    </tr>\n    <tr>\n        <th scope="row">out_order_id</th>\n        <td>商户订单ID</td>\n        <td>string</td>\n        <td>必填</td>\n        <td>商户传过来的订单ID</td>\n    </tr>\n    <tr>\n        <th scope="row">money</th>\n        <td>订单交易金额</td>\n        <td>string</td>\n        <td>必填</td>\n        <td>本次交易的金额</td>\n    </tr>\n    <tr>\n        <th scope="row">rndstr</th>\n        <td>随机字符串</td>\n        <td>string</td>\n        <td>必填</td>\n        <td>随机字符串</td>\n    </tr>\n    <tr>\n        <th scope="row">pay_type</th>\n        <td>支付方式</td>\n        <td>string</td>\n        <td>必填</td>\n        <td>支付方式,ALIPAY/WXPAY 两种</td>\n    </tr>\n     <tr>\n        <th scope="row">sign</th>\n        <td>签名</td>\n        <td>string</td>\n        <td>必填</td>\n        <td>签名验证</td>\n    </tr>\n    </tbody>\n</table>\n\n\n\n<h2 id="-">回调返回值</h2>\n<h5 id="-success-1-5-15-30-60-">必须是大写的SUCCESS，如果不是这个返回字符串,都表示不成功.系统会在1,5,15,30,60分钟后继续回调</h5>\n<h2 id="-">签名算法</h2>\n<h5 style=\'line-height: 25px;\'>\n将发送服务器的所有参数 按字母正序排序(A-B-C-D 顺序).去掉空值. 按照 key1+value1+key2+value2+商户密钥.将字符串链接.注意+号只是表示连接字符的意思.真实不存在. 例如:merchantid=17700212,money=100.00,密钥为CaqbIGpvP44q9TgZy3KitkYKxDnrnWvF拼接字符换为: merchantid17700212money100.00CaqbIGpvP44q9TgZy3KitkYKxDnrnWvF然后md5加密.得到字串,小写\n</h5>  \n\n<h2 id="-">示例:</h2>\n<ul>\n<li>商户ID: 17889023</li>\n<li>商户密钥: ace679b5efe7f62872a976c7b43069ae\n此商户ID和密钥仅供签名参照.</li>\n<li>&quot;merchantid&quot;: 17889023,</li>\n<li>&quot;orderid&quot;: 1540896744,</li>\n<li>&quot;amount&quot;: 10,</li>\n<li>&quot;paytype&quot;: &quot;ALIPAY&quot;,</li>\n<li>&quot;client_ip&quot;: &quot;127.0.0.1&quot;<h4 id="md5-">md5拼接字符串:</h4>\namount10client_ip127.0.0.1merchantid17889023orderid1540896457paytypeALIPAYace679b5efe7f62872a976c7b43069ae</li>\n</ul>\n<h4 id="-">请求链接:</h4>\n<p><a href="https://xpapi.ukafu.com/xppayapi?merchantid=17889023&amp;orderid=1540896121&amp;amount=10&amp;paytype=ALIPAY&amp;client_ip=127.0.0.1&amp;sign=00af60c769b0724c279992ac3a54a0ec">https://xpapi.ukafu.com/xppayapi?merchantid=17889023&amp;orderid=1540896121&amp;amount=10&amp;paytype=ALIPAY&amp;client_ip=127.0.0.1&amp;sign=00af60c769b0724c279992ac3a54a0ec</a></p>\n<p>签名: 00af60c769b0724c279992ac3a54a0ec</p>\n'},function(t,n){t.exports='<p><code>npm install</code></p>\n<h4 id="api-transaction-query">api-transaction-query</h4>\n'},function(t,n,d){t.exports='<h2 id="-">安装文档</h2>\n<h4 id="-root-root-">适用于所有手机.root和没root都行</h4>\n<h4 id="-">文件清单:为了保持文档统一,以下软件均未指定版本号</h4>\n<ul>\n<li>a)VirtualXposed 虚拟xposed 必选</li>\n<li>b)xppay    收款助手 必需</li>\n<li>c)支付宝 可选</li>\n<li>d)微信 可选</li>\n<li>e)QQ 可选</li>\n</ul>\n<h4 id="1-">1.将所有需要安装的软件发送到手机上</h4>\n<h4 id="2-1_virtualxposed_0-12-7-apk">2.首先在手机上安装1_VirtualXposed_0.12.7.apk</h4>\n<h5 id="-">这个软件是基础.所有的后续工作都在这个软件里头进行.</h5>\n<h4 id="3-">3.打开刚安装好的软件.</h4>\n<img  src="'+d(1)+'" alt="个人支付PC页面" />\n\n<h4 id="4-">4.点击这个按钮</h4>\n<img  src="'+d(2)+'" alt="个人支付PC页面" />\n\n<h4 id="5-">5.点击添加应用</h4>\n<img  src="'+d(3)+'" alt="个人支付PC页面" />\n\n<h4 id="6-">6.选中需要安装的程序.点击安装.</h4>\n<h5 id="-qq-">重复以上步骤,安装所有必须安装的程序.可选的部分根据自己需求安装:微信/QQ/支付宝.</h5>\n<h5 id="-qq-">建议使用支付宝.微信可能会被封号.QQ使用率太低.</h5>\n<h4 id="7-xposed-">7.回到xposed 设置页.选择模块管理,给收款助手打个勾.表示启用.</h4>\n<img  src="'+d(4)+'" alt="个人支付PC页面" />\n<img  src="'+d(5)+'" alt="个人支付PC页面" />\n\n<h4 id="8-xposed">8.重启xposed</h4>\n<h4 id="9-">9.打开收款助手</h4>\n<img  src="'+d(6)+'" alt="个人支付PC页面" />\n\n<h5 id="-">如果前面步骤都正确.此时能看到登陆后的界面.</h5>\n<h4 id="10-">10.在主界面打开商户密钥.查看商户信息</h4>\n<img  src="'+d(7)+'" alt="个人支付PC页面" />\n\n<h4 id="11-">11.拿到商户密钥之后.开始对接支付接口.</h4>\n'},,,,,,,,,,function(t,n){},,,,,,function(t,n){},,,,,,function(t,n){},,,,function(t,n){}]]);